import React from "react";
// import "./style.css"


function Jumbotron() {
  return (
    <div className="jumbotron jumbotron-fluid">
  <div className="container">
    <h1 className="display-4">Reading List</h1>
    <p className="lead"></p>
  </div>
</div>
      
    
  );
}



export default Jumbotron;
